function: "I saw this http://www.thingiverse.com/thing:3252 and a year later i had the idea to make my own with the initials of my family members as a gift.\r\nHere are the files for the main design and then the printing plates.\r\nI did this with tinkercad so it's mostly a guide to make your own... (i don't think anyone would print mines)\r\nif you want one with your name or any other but cant make them, you can always ask me and i'll do what i can to make yours...(you can also switch the letters order and reuse the ones i did)\r\n\r\nHere are the links for tinkercad files:\r\nALA https://tinkercad.com/p/acc0059ecc3ec3f1/13\r\nALA print 1 https://tinkercad.com/p/acc07c65d46a02a0/16\r\nALA print 2 https://tinkercad.com/p/acc09302c8e02a6c/6\r\nMBA https://tinkercad.com/p/acc010212c479828/27\r\nMBA print 1 https://tinkercad.com/p/acc085764c36b86a/50\r\nMBA print 2 https://tinkercad.com/p/acc0c4b869be63cc/4\r\nSAP https://tinkercad.com/p/acc08d20926f3398/50\r\nSAP print https://tinkercad.com/p/acc0ea5a2b423376/59\r\nSMA https://tinkercad.com/p/acc0694dc9cbceef/20"
